import React from 'react';
import ReactDOM from 'react-dom/client';
import { PagesContextProvider } from './contexts/PagesContext';
import App from './App';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <PagesContextProvider>
      <App />
    </PagesContextProvider>
  </React.StrictMode>
);
